import React from "react";

function Footer() {
  const year = new Date().getFullYear();

  return (
    <>
      <i class="fa fa-github fa-2x" style={{ color: "white" }}></i>

      <footer className="footer">Made with ❤️ by Timothy Merritt, {year}</footer>
    </>
  );
}

export default Footer;
